Sphere::Sphere(bool texCamFull) : Object2D(false), Dynamic2D() {

    LOGV(LOG_LEVEL_SPHERE, 0, LOG_FORMAT(" - t:%s"), __PRETTY_FUNCTION__, __LINE__, (texCamFull)? "true":"false");
    assert((sizeof(g_FullTexCoords) / sizeof(float)) == TEXCOORD_BUFFER_SIZE);

    mTransform = new float[TRANSFORM_BUFFER_SIZE];
    std::memset(mTransform, 0, sizeof(float) * TRANSFORM_BUFFER_SIZE);

    mVertices = const_cast<float*>(g_SphereVertices);
    mTexCoords = (texCamFull)? const_cast<float*>(g_CamTexCoords):const_cast<float*>(g_FullTexCoords);
}
Sphere::~Sphere() {

    LOGV(LOG_LEVEL_SPHERE, 0, LOG_FORMAT(), __PRETTY_FUNCTION__, __LINE__);
    mTexCoords = NULL; // Avoid 'Object' destructor to delete it
}

void Sphere::start(unsigned char texture) {

    LOGV(LOG_LEVEL_SPHERE, 0, LOG_FORMAT(), __PRETTY_FUNCTION__, __LINE__);
    Object2D::start(texture);

    std::memcpy(mTransform, Object2D::TransformBuffer, sizeof(float) * TRANSFORM_BUFFER_SIZE);

    // Make a correction on indices (that start from -40)
    rotate(37.5f * PI_F / 180.f); // => -2.5 for texture coordinates correction (that start from -2.5)
    // NOTE: In fact indices start from -50 not -40 !?!? See 'Summary/Response::start' method
}

void Sphere::render(bool resetUniform) const {

#ifdef DEBUG
    LOGV(LOG_LEVEL_SPHERE, (*mLog % 100), LOG_FORMAT(" - r:%s (u:%s)"), __PRETTY_FUNCTION__, __LINE__,
            (resetUniform)? "true":"false", (mUpdated)? "true":"false");
    if ((resetUniform) || (mUpdated))
        Dynamic2D::transform(getShader2D(), mLog);
#else
    if ((resetUniform) || (mUpdated))
        Dynamic2D::transform(getShader2D());
#endif

    Object2D::render(false);
    glDrawElements(GL_TRIANGLES, sizeof(g_SphereIndices) / sizeof(short), GL_UNSIGNED_SHORT, g_SphereIndices);
}

